  01> DISBROWE, Noel John Edward m on 01.05.1957 to WHITE, Alison Johanna Lovell
  b 19.05.1928
  b 02.09.1932
  John b. at Portsmouth, England. Address: "Ngamawhetu", Keanes Road, RD 1, Howick, Auckland.
  John was educated at St Edward's, Oxford then joined the Royal Marines. He emigrated to New Zealand in
  1954 and farmed until 1962 when he went into the life assurance industry. He retired as branch manager
  for South Auckland of NZI Life in 1986 and is now running his farm at Maraetai. John and Alison have
  set up an equine centre for their son, Hamish.
  01> DISBROWE, Christina Frances m on 12.02.1987 to FORSTER, David Blair
  b 17.10.1961
  b 30.04.1961
