  02> DISBROWE, Suzanne Cathryn m on 24.11.1988 to TUCKER, Nic
  b 19.11.1964
  b ** ** ****
  Suzanne b. at Hamilton. Nic is a civil engineer working on the new London Library.
  03> DISBROWE, Hamish John
  b 02.09.1967
  Hamish b. at Hamilton. Address: "Ngamawhetu", Keanes Road, RD 1 Howick, Auckland.
  Hamish was educated at King's College (1981-85) where he was Head of House, Captain of Hockey and
  joint recipient of the Headmaster's Supreme Award. Hamish teaches riding at home in summer and in
  Japan in winter. He has had riding experience in Britain, the United States, Japan, Australia and
  New Zealand and has captained a junior eventing team to Australia.
  DISBROWE, Pamela Loism on 19.04.1986 to ATTWOOD, John
  b 24.07.1929
  b 21.07.1922
  Pamela b. at Southsea, Hampshire, England and m, at St Thomas-a-Beckett, Warblington, Havant, Hants,
  England, John, s/o FN Attwood and Ursule de Salis, b. at East Marden, Sussex, England, Address: 19
  Pells Close, Guilsborough, Northampton NNG 8QR, England,
  Pamela was a nurse, midwife and health visitor. John served in the Royal Navy and was an electrical
  engineer. Both now retired.
  John is active in church affairs, and takes services in their village church and in surrounding
  villages. He has retired as a church warden after 20 years service.
